import { useState } from 'react';

export default function LoginModal()
{
    const [isOpen, setIsOpen] = useState(false);

    function toggleIsOpen() { setIsOpen(!isOpen); }

    return (
        <>
        <button className="px-4 py-2 bg-blue-600 text-white rounded hover:bg-blue-700" onClick={() => {setIsOpen(true);}}>모달 열기</button>
            {isOpen &&
                <div>
                    <button onClick={toggleIsOpen}>모달 닫기</button>
                </div>
            }
        </>
    );
}
